  //       )}
  //     </>
  //   );
  // };

  return (
    <Router>
      <div className="App">
        {isLoggedIn ? (
          <Nav isLoggedIn={isLoggedIn} setIsLoggedIn={setIsLoggedIn} />
        ) : (
          <GoogleLogin
            onSuccess={(res) => {
              success(res);
              setIsLoggedIn(true);
            }}
            onFailure={error}
            clientId={clientId}
            isSignedIn={true}
